import React from 'react'

const Weather = ({ addWeatherForm }) => {
  return (
    <div className="Weather">
      <div className="m-3">
        Vzhledem k tomu, že se jedná o zahraniční API, tak se musí města psát v
        angličtině, tedy Praha se píše Prague například
      </div>
      {addWeatherForm}
    </div>
  )
}

export default Weather
